import { Link } from "react-router-dom";

function Header() {
  return (
    <>
      <head>
        {/* Meta Information */}
        <meta charSet="utf-8" />
        <meta name="viewport" content="width=device-width, initial-scale=1" />
        <meta name="theme-color" content="#000000" />
        <meta name="description" content="Web site created using create-react-app" />

        {/* Stylesheets */}
        <link rel="stylesheet" href="assets/css/normalize.css" />
        <link rel="stylesheet" href="assets/css/font-awesome.min.css" />
        <link rel="stylesheet" href="assets/css/fontello.css" />
        <link href="assets/fonts/icon-7-stroke/css/pe-icon-7-stroke.css" rel="stylesheet" />
        <link href="assets/fonts/icon-7-stroke/css/helper.css" rel="stylesheet" />
        <link href="assets/css/animate.css" rel="stylesheet" media="screen" />
        <link rel="stylesheet" href="assets/css/bootstrap-select.min.css" />
        <link rel="stylesheet" href="bootstrap/css/bootstrap.min.css" />
        <link rel="stylesheet" href="assets/css/icheck.min_all.css" />
        <link rel="stylesheet" href="assets/css/price-range.css" />
        <link rel="stylesheet" href="assets/css/owl.carousel.css" />
        <link rel="stylesheet" href="assets/css/owl.theme.css" />
        <link rel="stylesheet" href="assets/css/owl.transitions.css" />
        <link rel="stylesheet" href="assets/css/style.css" />
        <link rel="stylesheet" href="assets/css/responsive.css" />

        <title>React App</title>
      </head>

      <body>
        <div className="header-wrapper">
          <nav className="custom-navbar">
            <div className="container">
              <div className="navbar-header">
                <button
                  type="button"
                  className="navbar-toggle collapsed"
                  data-toggle="collapse"
                  data-target="#navigation"
                >
                  <span className="sr-only">Toggle navigation</span>
                  <span className="icon-bar"></span>
                  <span className="icon-bar"></span>
                  <span className="icon-bar"></span>
                </button>
                <a className="navbar-brand" href="index.html">
                  <img src="./assets/img/logo.png" alt="" />
                </a>
              </div>

              <div className="collapse navbar-collapse yamm" id="navigation">
                <div className="button navbar-right">
                  <button
                    className="navbar-btn nav-button login"
                    onClick={() => window.open("register.html")}
                  >
                    Login
                  </button>
                  <button
                    className="navbar-btn nav-button"
                    onClick={() => window.open("submit-property.html")}
                  >
                    Submit
                  </button>
                </div>
                <ul className="main-nav nav navbar-nav navbar-right">
                  <li className="dropdown ymm-sw">
                    <a href="index.html" className="active">
                      Home
                    </a>
                  </li>
                  <li>
                    <Link
                      to="/buy"
                      style={{
                        color: "inherit",
                        fontWeight: "inherit",
                        textDecoration: "none",
                      }}
                    >
                      Buy
                    </Link>
                  </li>
                  <li>
                    <Link
                      style={{
                        color: "inherit",
                        fontWeight: "inherit",
                        textDecoration: "none",
                      }}
                    >
                      Sell
                    </Link>
                  </li>
                  <li className="dropdown yamm-fw">
                    <a href="#">
                      Template <b className="caret"></b>
                    </a>
                  </li>
                  <li>
                    <a href="contact.html">Contact</a>
                  </li>
                </ul>
              </div>
            </div>
          </nav>
        </div>

        <style>
          {`
          /* Override Bootstrap styles for this component */
          .header-wrapper .custom-navbar {
            background-color: #f8f9fa;
            padding: 1rem;
          }

          .header-wrapper .custom-navbar .navbar-btn {
            background-color: #007bff;
            color: white;
            border: none;
            padding: 0.5rem 1rem;
            border-radius: 5px;
            cursor: pointer;
          }

          .header-wrapper .custom-navbar .navbar-btn:hover {
            background-color: #0056b3;
          }

          .header-wrapper .custom-navbar .nav > li > a {
            color: #000;
            font-weight: bold;
            text-decoration: none;
          }

          .header-wrapper .custom-navbar .nav > li > a:hover {
            color: #007bff;
          }

          .header-wrapper .custom-navbar .navbar-brand img {
            max-height: 50px;
          }
        `}
        </style>
      </body>
    </>
  );
}

export default Header;
